content: "\n## <a name=\"links\"></a>Nuorodos \n* [Visual J# palaikymo informacija](https://msdn.microsoft.com/vstudio/bb188593)\n* [Migracijos gairės](/visualstudio/porting/port-migrate-and-upgrade-visual-studio-projects?view=vs-2019)\n* [Visual Studio produkto informacija](https://www.VisualStudio.com)\n\n> [!NOTE]\n> Baigėsi šio produkto palaikymas. Toliau pateikiamos nuorodos į migraciją.\n> [!NOTE]\n> Microsoft Visual Studio 2005 team Edition duomenų bazės specialistams išleistas 2007 m. kovo 2 d.\n\n## <a name=\"editions\"></a>Leidimai \n* Profesinės\n* Standartinis\n* Standard Edition akademinė licencija\n* Team Edition duomenų bazės profesionalams\n* Team Edition programinės įrangos architektams\n* \"Team Edition\", skirtas programinės įrangos kūrėjams\n* Team Edition programinės įrangos testeriai\n* Liukso numeris \"Team\"\n* Komandos bandymo apkrovos agentas\n* Įrankiai, skirti Microsoft Office sistemai\n* VB Express\n* Vaizdinis C# Express\n* Visual C ++ Express\n* Visual J# Express\n* Visual Web Developer Express"
